import React from 'react'

class GlobalNav extends React.Component {
    render() {
        return (
            <nav id="global-nav">
                <div className="global-nav-header">
                    <h3>Bootstrap Sidebar</h3>
                </div>
                <a href="#">About</a>
                <a href="#">About</a>
                <a href="#">About</a>
                <a href="#">About</a>
            </nav>
        )
    }
}

export default GlobalNav
